import React from "react";

const FavoritCards = ({ likedCards }) => {
  return (
    <div className="bodyAbout">
      <h1>Favorite Cards</h1>
      {likedCards.length === 0 ? (
        <p>No favorite cards selected yet.</p>
      ) : (
        <ul>
          {likedCards.map((cardId) => (
            <li key={cardId}>
              {/* Display relevant card details from the original cards array */}
              {/* Assuming cards array has all necessary details */}
              <img
                src={cards.find((card) => card._id === cardId)?.image.url}
                alt={cards.find((card) => card._id === cardId)?.image.alt}
              />
              <h2>{cards.find((card) => card._id === cardId)?.title}</h2>
              <p>{cards.find((card) => card._id === cardId)?.subtitle}</p>
              <p>{cards.find((card) => card._id === cardId)?.address.country}</p>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default FavoritCards;
